import { ListItemText, ListItemIcon, ListItemButton } from "@mui/material";
import SearchIcon from '@mui/material/Searcj';
export default function AppbarDesktop ({matches}){
    return (
        /* Appbar Container
        Header
        List */
        <AppbarContainer>
                <MyList type="row" >
            <ListItemText primary="Home"/>
            <ListItemText primary="Products"/>
            </MyList>
            <AppbarHeader>Glazier.</AppbarHeader>
<MyList >
            <ListItemText primary="Account"/>
            <ListItemButton>
                <ListItemIcon>
                    <SearchIcon />
                </ListItemIcon>
            </ListItemButton>
            </MyList>
            </AppbarContainer>
    );
}
